import React, { useEffect, useState } from "react";
import SkillForm from "./SkillForm";
import SkillCategory from "./SkillCategory";
import SkillItem from "./SkillItem";
import {
  DndContext,
  closestCenter,
  PointerSensor,
  useSensor,
  useSensors,
  DragOverlay,
} from "@dnd-kit/core";
import { arrayMove } from "@dnd-kit/sortable";

const API_URL = process.env.REACT_APP_API_URL + "/skills";
const USER_ID = process.env.REACT_APP_USER_ID;

export default function SkillList() {
  const [skills, setSkills] = useState([]);
  const [activeId, setActiveId] = useState(null);

  const sensors = useSensors(useSensor(PointerSensor));

  // Load skills on mount
  useEffect(() => {
    fetchSkills();
  }, []);

  const fetchSkills = async () => {
    try {
      const res = await fetch(`${API_URL}?user_id=${USER_ID}`);
      const data = await res.json();
      setSkills(data);
    } catch (err) {
      console.error("Fetch failed:", err);
    }
  };

  const addSkill = async (skill) => {
    if (skills.some(s => s.name.toLowerCase() === skill.name.toLowerCase() && s.category === skill.category)) {
      return alert("Skill already exists in this category");
    }
    try {
      const res = await fetch(API_URL, {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ ...skill, user_id: USER_ID }),
      });
      const addedSkill = await res.json();
      setSkills(prev => [...prev, addedSkill]);
    } catch (err) {
      console.error(err);
    }
  };

  const updateSkill = async (id, updatedFields) => {
    try {
      await fetch(`${API_URL}/${id}?user_id=${USER_ID}`, {
        method: "PUT",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify(updatedFields),
      });
      setSkills(prev => prev.map(s => (s.id === id ? { ...s, ...updatedFields } : s)));
    } catch (err) {
      console.error(err);
    }
  };

  const removeSkill = async (id) => {
    if (!window.confirm("Remove this skill?")) return;
    try {
      await fetch(`${API_URL}/${id}?user_id=${USER_ID}`, { method: "DELETE" });
      setSkills(prev => prev.filter(s => s.id !== id));
    } catch (err) {
      console.error(err);
    }
  };

  const handleDragStart = (event) => {
    setActiveId(event.active.id);
  };

  const handleDragEnd = async (event) => {
    const { active, over } = event;
    setActiveId(null);
    if (!active) return;

    const activeSkill = skills.find(s => s.id === active.id);
    if (!activeSkill) return;

    const overSkill = over ? skills.find(s => s.id === over.id) : null;
    const targetCategory = overSkill ? overSkill.category : activeSkill.category;
    const categoryChanged = activeSkill.category !== targetCategory;

    // Update frontend immediately
    setSkills(prevSkills => {
      const remainingSkills = prevSkills.filter(s => s.id !== active.id);
      const targetSkills = remainingSkills.filter(s => s.category === targetCategory);

      const overIndex = overSkill ? targetSkills.findIndex(s => s.id === over.id) : targetSkills.length;
      const movedSkill = { ...activeSkill, category: targetCategory };

      const newTargetSkills = [...targetSkills];
      newTargetSkills.splice(overIndex, 0, movedSkill);
      newTargetSkills.forEach((s, idx) => s.position = idx);

      const updatedSkills = [
        ...remainingSkills.filter(s => s.category !== targetCategory),
        ...newTargetSkills
      ];

      return updatedSkills;
    });

    // Update backend for the moved skill
    const updatedSkill = { ...activeSkill, category: targetCategory, position: overSkill?.position ?? 0 };
    await updateSkill(updatedSkill.id, updatedSkill);

    // If category changed, refresh the full list
    if (categoryChanged) {
      fetchSkills();
    }
  };

  const activeSkillObj = skills.find(s => s.id === activeId);

  return (
    <div>
      <h2>Add Skill</h2>
      <SkillForm addSkill={addSkill} existingSkills={skills} />

      <DndContext
        sensors={sensors}
        collisionDetection={closestCenter}
        onDragStart={handleDragStart}
        onDragEnd={handleDragEnd}
      >
        {["Technical", "Soft Skills", "Languages", "Industry-Specific"].map(cat => (
          <SkillCategory
            key={cat}
            category={cat}
            skills={skills.filter(s => s.category === cat).sort((a, b) => a.position - b.position)}
            updateSkill={updateSkill}
            removeSkill={removeSkill}
          />
        ))}

        <DragOverlay>
          {activeSkillObj ? (
            <SkillItem
              skill={activeSkillObj}
              updateSkill={updateSkill}
              removeSkill={removeSkill}
            />
          ) : null}
        </DragOverlay>
      </DndContext>
    </div>
  );
}
